import React from 'react'

const parentDiv = {
    height: '100px',
    backgroundColor: 'lightblue',
    display: 'flex',
    justifyContent: 'space-around'
};

const logo = {
    backgroundColor: 'grey',
    fontSize: '25px',
    fontFamily: 'fantasy',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    opacity: .5,

};

const otherPage = {
    backgroundColor: 'black',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
};

const auth = {
    backgroundColor: 'yellow',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
};
const Navbar = () => {
  return (
    <nav style={parentDiv}>
        <div style={logo}>Shortly</div>
        <div style={otherPage}>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/blogs">Blogs</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>

        </div>
        <div style={auth}>Auth</div>
    </nav>
  )
}

export default Navbar;
